INSERT INTO 
                starchart_repositories (
                    hostname_id, owner_id, name, description, html_url, website, created,
                    last_crawl, imported
                )
                VALUES (
                    (SELECT ID FROM starchart_forges WHERE hostname = $1),
                    (SELECT ID FROM starchart_users WHERE username = $2),
                    $3, $4, $5, $6, $7, $8, $9
                );

